import React from 'react';
import AddToQueueIcon from '@material-ui/icons/AddToQueue';

const handleClick = (e) => {
  console.log("handling fave click!");
}

function Fave(){
  return (
    <div onClick={this.handleClick} className="film-row-fave add_to_queue">
      <AddToQueueIcon />
    </div>
  )
}

export default Fave;
